window.bookSummaryJSON = "<p><b>Everyone has secrets.</b></p> <p>YouTube baking sensation April Masterson knows the secret to the perfect gooey brownies. Or how to make key lime squares that will melt in your mouth. But if you keep watching her offline, you may find out some other secrets about April; secrets she’d rather you didn’t know - like where did her son go when he snuck out of the house? What was she doing with the local soccer coach behind fogged windows? And what’s buried in her backyard?</p> <p>Everyone has secrets. Some are worse than others. April’s secrets are enough to destroy her. I’ll make sure of that.</p>"; 
